/* eslint-disable react/style-prop-object */
import React from "react";
import styled from "styled-components";
import Footer from "./footer";
import Navbar from "./header";

const Dove = styled.div`
position:absolute;
margin-top:20%;
`
;

const Where = () => {
    return(
    <article className = "body">
        <Navbar></Navbar>
    <section className="googleform">
        <Dove>
        <iframe title="loco" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3139.786624508083!2d15.635810915326928!3d38.09863017970184!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x13145a81b22412f7%3A0x869c14256a141cbc!2sDIGITAL%20PHOTO%20DI%20FRANCO%20FONTANA!5e0!3m2!1sit!2sit!4v1645452317694!5m2!1sit!2sit" width="200%" height="100%," style={{border:0}} allowfullscreen="" loading="lazy"></iframe>
        </Dove>
        <Footer/>
    </section>

    </article>)
}
export default Where;
